import teacher from "../assets/teacher.svg";
import React from "react";
function Header({ className }) {
    return (
        <div className="App-header">
            <div><img src={teacher} alt={''}/></div>
            <div>HelpClassManager</div>
            <div>{className}</div>
        </div>
    )
}
export default Header;
